def migratoryBirds(arr)
    # Write your code here
        aux = [0,0,0,0,0]
        arr.each do |elem|
            if elem == 1
                aux[0] += 1
            elsif elem == 2
                aux[1] += 1
            elsif elem == 3
                aux[2] += 1
            elsif elem == 4
                aux[3] += 1
            elsif elem == 5
                aux[4] += 1
            end

        end
        max = aux.max
        aux2 = []
        aux.each_with_index do |elem, i|
            if elem == max then aux2.push(i+1) end
        end
        aux2.min

end

